import './Footer.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

import { Col, Container, Row } from "react-bootstrap";

function Footer(){

    const ArraysOfFooter = [{
        id: 1,
        title: '',
        list1: '',
        list2: '',
        list3: '',
        list4: ''
    }];
    const ArraysOfFooterOnMap = ArraysOfFooter.map((ArrayOfFooter) => 
    <Col key = {ArrayOfFooter.id} lg = "2" md = "4" sm = "4">
        <h3>{ArrayOfFooter.title}</h3>
        <ul className = "footer-list">
            <li>{ArrayOfFooter.list1}</li>
            <li>{ArrayOfFooter.list2}</li>
            <li>{ArrayOfFooter.list3}</li>
            <li>{ArrayOfFooter.list4}</li>
        </ul>
    </Col>
    )

    return(
        <Container fluid>
            <Row>
                {ArraysOfFooterOnMap}
            </Row>
        </Container>
    )
}

export default Footer
